    in each borough. This list is a summary of neighborhood sales for Class 1-, 2- and
    3-Family homes in Queens in 2007.rnrnThis list includes all sales of 1-, 2-, and
    3-Family Homes' from January 1st, 2007 to December 31, 2007, whose sale price is
    equal to or more than $150,000.  The Building Class Category for Sales is based
    on the Building Class at the time of the sale.rnrnUpdate Schedule: Annually",nt"license_title":
